import React, { FC } from "react";
import styled from "styled-components";

interface HighlightCardProps {
  width: string;
  height: string;
}

const HighlightCard: FC<HighlightCardProps> = ({ width, height }) => {
  return <Container >Highlight Card</Container>;
};

export default HighlightCard;

interface CardProps {
  $width?: string;
  $height?: string;
}

const Container = styled.div<CardProps>`
  color: white;
`;
